import { Component } from "react";


export default class Product extends Component{
  constructor(props){
 
    super(props)
  
  }
 
  render(){
  return (
    <div>
      
      {Object.keys(this.props.data).map(key =>(
           <div
           style={{ height: 150, margin: 10, padding: 10, backgroundColor: "red" }}
         >
           {key.name}
         
         </div>
      ))}
       
        
     
      
      </div>
    
  );
      }
}
